// Header.js
import React from 'react';

const Header = () => {
  return (
    <header className="bg-white shadow p-4 flex justify-between items-center">
      {/* Left side: Welcome message or breadcrumbs */}
      <div>
        <h1 className="text-xl font-semibold">Welcome To Dashboard</h1>
        <p>Early Fire Prediction</p>
      </div>
      {/* Right side: User profile and notifications */}
      <div>
        <button className="p-2.5 mr-4">Notifications</button>
        <button className="p-2.5">Profile</button>
      </div>
    </header>
  );
};

export default Header;
